    max_allowed = 1 if current_line.depth else 2

    # Remove extra newlines from the first leaf's prefix
    first_leaf = current_line.leaves[0] if current_line.leaves else None
    before = first_leaf.prefix.count("\n") if first_leaf else 0
    before = min(before, max_allowed)

    if first_leaf:
        first_leaf.prefix = ""

    # Rest of the logic based on different conditions
    if current_line.depth > 0:
        newlines = 1
    else:
        newlines = 2 if not current_line.is_decorator else 0

    if current_line.is_flow_control:
        return before, 1

    if (
        self.previous_line
        and self.previous_line.is_import
        and not current_line.is_import
        and current_line.depth == self.previous_line.depth
    ):
        return before or 1, 0

    if (
        self.previous_line
        and self.previous_line.is_yield
        and (not current_line.is_yield or current_line.depth != self.previous_line.depth)
    ):
